CREATE TABLE m_accessory_grade_up(
  accessory_master_id INTEGER NOT NULL,
  grade INTEGER NOT NULL,
  max_level INTEGER NOT NULL,
  accessory_passive_skill_1_master_id INTEGER,
  accessory_passive_skill_2_master_id INTEGER,
  PRIMARY KEY (accessory_master_id, grade),
  FOREIGN KEY (accessory_master_id) REFERENCES m_accessory(id),
  FOREIGN KEY (accessory_passive_skill_1_master_id) REFERENCES m_accessory_passive_skill(id),
  FOREIGN KEY (accessory_passive_skill_2_master_id) REFERENCES m_accessory_passive_skill(id)
);
